const BlogList = ({Blogs, title}) => {
    
    //const Blogs = props.blogs

    console.log(Blogs)

    return (  
    <div className="blogs-list" >
        <h2> { title } </h2>
    {Blogs.map((blog) => (
        <div className='blog-preview' Key={blog.id}>
         <h2> {blog.title} </h2>
         <p>Written by {blog.author}</p>
         </div>
    ))}
 </div>

    );
}
 
export default BlogList;
